import React from 'react';
import "./File/File.scss";
import HeadApp from "../components/HeadApp";
const File = () => {
    return (
        
        <div className="file">
            <div>
                <ul>
                    <div>
                        <div>
                        <li>Fichier Récents</li>
                        </div>
                        <div><li>Fichier téléchargés</li></div>
                        <div><li>Fichier Partagés</li></div>
                    </div>
                    <div>
                        <div><p>Mettre en ligne</p></div>
                        
                    </div>
                </ul>
            </div>
            <div></div>
            
        </div>
    );
};

export default File;
